  let emptyArray = new Array();
  const [users,setUsers] = useState(emptyArray);
  const addUserHandler = user => {
    setUsers((prevUsers) => { // prevExpenses is a parameter, not a pre-existing variable
      return [user, ...prevUsers];
    });
  };

  return (
    <div>
      <Hdr />
      <AddUser />
      <UsersList />
    </div>
  );
}

export default App;
